import axios from "axios";

const BASE_URL = process.env.REACT_APP_API_BASE_URL || "http://localhost:4040";

const axiosInstance = axios.create({
  baseURL: BASE_URL,
  headers: {
    "Content-Type": "application/json"
  }
});

axiosInstance.interceptors.request.use(config => {
  const token = localStorage.getItem("token");
  if (token) {
    config.headers.Authorization = `Bearer ${token}`;
  }
  return config;
});

export default class ApiService {
  /**AUTH */
  static async registerUser(registration) {
    try {
      const response = await axiosInstance.post(`/auth/register`, registration);
      return response.data;
    } catch (error) {
      throw error.response?.data || error;
    }
  }

  static async loginUser(loginDetails) {
    try {
      const response = await axiosInstance.post(`/auth/login`, loginDetails);
      return response.data;
    } catch (error) {
      throw error.response?.data || error;
    }
  }

  static isAuthenticated() {
    return !!localStorage.getItem("token");
  }

  /**USERS */
  static async getAllUsers() {
    try {
      const response = await axiosInstance.get(`/users/all`);
      return response.data;
    } catch (error) {
      throw error.response?.data || error;
    }
  }

  static async getCurrentUser() {
    try {
      const response = await axiosInstance.get(`/users/current`);
      return response.data;
    } catch (error) {
      throw error.response?.data || error;
    }
  }

  /**ROOMS */
  static async getAllRoomTypes() {
    try {
      const response = await axiosInstance.get(`/rooms/types`);
      return response.data;
    } catch (error) {
      throw error.response?.data || error;
    }
  }

  static async getAllRooms() {
    try {
      const response = await axiosInstance.get(`/rooms`);
      return response.data;
    } catch (error) {
      throw error.response?.data || error;
    }
  }

  static async addNewRoom(roomData) {
    try {
      const formData = new FormData();
      formData.append('photo', roomData.photo);
      formData.append('roomType', roomData.roomType);
      formData.append('roomPrice', roomData.roomPrice);
      formData.append('description', roomData.description);

      const response = await axiosInstance.post(`/rooms/add`, formData, {
        headers: {
          "Content-Type": "multipart/form-data"
        }
      });
      return response.data;
    } catch (error) {
      throw error.response?.data || error;
    }
  }

  static async deleteRoom(roomId) {
    try {
      const response = await axiosInstance.delete(`/rooms/delete/${roomId}`);
      return response.data;
    } catch (error) {
      throw error.response?.data || error;
    }
  }

  static async updateRoom(roomId, roomData) {
    try {
      const formData = new FormData();
      formData.append('description', roomData.description);
      formData.append('roomType', roomData.roomType);
      formData.append('roomPrice', roomData.roomPrice);
      if (roomData.photo) {
        formData.append('photo', roomData.photo);
      }

      const response = await axiosInstance.put(`/rooms/update/${roomId}`, formData, {
        headers: {
          "Content-Type": "multipart/form-data"
        }
      });
      return response.data;
    } catch (error) {
      throw error.response?.data || error;
    }
  }

  static async getRoomById(roomId) {
    try {
      const response = await axiosInstance.get(`/rooms/${roomId}`);
      return response.data;
    } catch (error) {
      throw error.response?.data || error;
    }
  }

  static async getAvailableRoomsByDateAndType(checkInDate, checkOutDate, roomType) {
    try {
      const response = await axiosInstance.get(`/rooms/availability`, {
        params: {
          checkInDate: checkInDate,
          checkOutDate: checkOutDate,
          roomType: roomType
        }
      });
      return response.data;
    } catch (error) {
      throw error.response?.data || error;
    }
  }

  static async getAllAvailableRooms() {
    try {
      const response = await axiosInstance.get(`/rooms/available`);
      return response.data;
    } catch (error) {
      throw error.response?.data || error;
    }
  }

  /** BOOKINGS */
  static async createBooking(bookingData) {
    try {
      const response = await axiosInstance.post(`/bookings/add`, bookingData);
      return response.data;
    } catch (error) {
      throw error.response?.data || error;
    }
  }

  static async getBookingByConfirmationCode(confirmationCode) {
    try {
      const response = await axiosInstance.get(`/bookings/find/${confirmationCode}`);
      return response.data;
    } catch (error) {
      throw error.response?.data || error;
    }
  }

  static async getAllBookings() {
    try {
      const response = await axiosInstance.get(`/bookings`);
      return response.data;
    } catch (error) {
      throw error.response?.data || error;
    }
  }

  static async getBookingsByUser(userId) {
    try {
      const response = await axiosInstance.get(`/bookings/user/${userId}`);
      return response.data;
    } catch (error) {
      throw error.response?.data || error;
    }
  }
}
